import React, { useState } from 'react';

function StartScreen() {
  const [isStarted, setIsStarted] = useState(false);

  const onStartClick = () => {
    setIsStarted(true);
    // Usa la tua funzione di routing per navigare alla rotta del quiz
  };

  return (
    <div>
      <h1>Quiz: Titolo del tuo quiz</h1>
      <p>Spiegazione del quiz e delle sue regole.</p>
      <button onClick={onStartClick}>Inizia il quiz!</button>
    </div>
  );
}

export default StartScreen;
